version = "0.1.0"
source = { editable = "." }
dependencies = [
    { name = "click" },
    { name = "duckdb" },
    { name = "httpx" },
    { name = "openpyxl" },
    { name = "polars", extra = ["pyarrow"] },
    { name = "python-dotenv" },
]

[package.optional-dependencies]
dev = [
    { name = "pyright" },
    { name = "pytest" },
]

[package.metadata]
requires-dist = [
    { name = "click", specifier = ">=8.3.1" },
    { name = "duckdb", specifier = ">=1.0.0" },
    { name = "httpx", specifier = ">=0.28.0" },
    { name = "openpyxl", specifier = ">=3.1.0" },
    { name = "polars", extras = ["pyarrow"], specifier = ">=1.0.0" },
    { name = "pyright", marker = "extra == 'dev'", specifier = ">=1.1.390" },
    { name = "pytest", marker = "extra == 'dev'", specifier = ">=9.0.0" },
    { name = "python-dotenv", specifier = ">=1.2.1" },
]
provides-extras = ["dev"]

